const OutputSequences = () => {
    var probeF = '';
    var probeQ = '';
    var sink = '';
    var sinkC = '';

    return (
        <div className="OutputSequences">
            <p>ProbeF: {probeF}</p>
            <p>ProbeQ: {probeQ}</p>
            <p>  Sink: {sink}</p>
            <p> Sink*: {sinkC}</p>
        </div>
    );
};

export default OutputSequences;
